static bool install(Storage* storage, const char* name, const uint8_t* app, int size){
	File* file = storage_file_alloc(storage);
	FuriString* path = furi_string_alloc_set_str("/ext/apps/TestSuite/");
	furi_string_cat_str(path, name);
	bool res = storage_file_open(file, furi_string_get_cstr(path), FSAM_WRITE, FSOM_OPEN_ALWAYS);
	if(res)
		storage_file_write(file, app, size);
	storage_file_close(file);
	storage_file_free(file);
	furi_string_free(path);
	return res;
}

bool state = 0;

// Screen is 128x64 px
static void app_draw_callback(Canvas* canvas, void* ctx) {
	UNUSED(ctx);

	canvas_clear(canvas);
	if(state) canvas_draw_str(canvas, 0, 12, "Installed!");
	else canvas_draw_str(canvas, 0, 12, "Installing...");
}

static void app_input_callback(InputEvent* input_event, void* ctx) {
	furi_assert(ctx);

	FuriMessageQueue* event_queue = ctx;
	furi_message_queue_put(event_queue, input_event, FuriWaitForever);
}

int32_t testsuite_installer_main(void* p) {
	UNUSED(p);
	FuriMessageQueue* event_queue = furi_message_queue_alloc(8, sizeof(InputEvent));

	// Configure view port
	ViewPort* view_port = view_port_alloc();
	view_port_draw_callback_set(view_port, app_draw_callback, view_port);
	view_port_input_callback_set(view_port, app_input_callback, event_queue);

	// Register view port in GUI
	Gui* gui = furi_record_open(RECORD_GUI);
	gui_add_view_port(gui, view_port, GuiLayerFullscreen);

	InputEvent event;

	Storage* storage = furi_record_open(RECORD_STORAGE);
	storage_simply_mkdir(storage, "/ext/apps/TestSuite");

	install(storage, "buttons.fap", FAP_BUTTONS, 2752);
	install(storage, "led.fap", FAP_LED, 2796);
	install(storage, "screen.fap", FAP_SCREEN, 2428);
	install(storage, "sound.fap", FAP_SOUND, 2508);
	install(storage, "vibro.fap", FAP_VIBRO, 2080);

	state = 1;

	furi_record_close(RECORD_STORAGE);

	bool running = true;
	while(running) {
		if(furi_message_queue_get(event_queue, &event, 100) == FuriStatusOk) {
			if(event.type == InputTypePress && event.key == InputKeyBack) running = false;
		}
		view_port_update(view_port);
	}

	view_port_enabled_set(view_port, false);
	gui_remove_view_port(gui, view_port);
	view_port_free(view_port);
	furi_message_queue_free(event_queue);

	furi_record_close(RECORD_GUI);

	return 0;
}
